    COALESCE( t1."Leaf_7", t1."Leaf_8", t1."Leaf_9", t1."Leaf_11", t1."Leaf_13", t1."Leaf_14", t1."Leaf_17", t1."Leaf_18", t1."Leaf_19", t1."Leaf_23", t1."Leaf_24", t1."Leaf_27", t1."Leaf_28", t1."Leaf_29", t1."Leaf_31", t1."Leaf_33", t1."Leaf_34", t1."Leaf_39", t1."Leaf_43", t1."Leaf_44", t1."Leaf_47", t1."Leaf_49", t1."Leaf_51", t1."Leaf_52", t1."Leaf_58", t1."Leaf_59", t1."Leaf_60", t1."Leaf_62", t1."Leaf_64", t1."Leaf_66", t1."Leaf_67", t1."Leaf_68", t1."Leaf_70", t1."Leaf_71", t1."Leaf_73", t1."Leaf_75", t1."Leaf_76", t1."Leaf_81", t1."Leaf_82", t1."Leaf_85", t1."Leaf_86", t1."Leaf_87", t1."Leaf_88", t1."Leaf_89", t1."Leaf_91", t1."Leaf_92", t1."Leaf_96", t1."Leaf_97", t1."Leaf_98", t1."Leaf_100", t1."Leaf_103", t1."Leaf_104", t1."Leaf_109", t1."Leaf_110", t1."Leaf_111", t1."Leaf_112", t1."Leaf_113", t1."Leaf_117", t1."Leaf_119", t1."Leaf_120", t1."Leaf_121", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_6" <= 0.500000) AND (t."X_8" <= 7.500000) AND (t."X_8" <= 5.500000) AND (t."X_8" <= 4.500000)) THEN 7 ELSE NULL END AS Leaf_7,
