    COALESCE( t1."Leaf_6", t1."Leaf_7", t1."Leaf_10", t1."Leaf_12", t1."Leaf_13", t1."Leaf_16", t1."Leaf_17", t1."Leaf_18", t1."Leaf_25", t1."Leaf_27", t1."Leaf_28", t1."Leaf_29", t1."Leaf_30", t1."Leaf_34", t1."Leaf_36", t1."Leaf_37", t1."Leaf_38", t1."Leaf_41", t1."Leaf_43", t1."Leaf_44", t1."Leaf_48", t1."Leaf_50", t1."Leaf_51", t1."Leaf_52", t1."Leaf_53", t1."Leaf_55", t1."Leaf_58", t1."Leaf_59", t1."Leaf_60", t1."Leaf_61", t1."Leaf_64", t1."Leaf_65", t1."Leaf_67", t1."Leaf_70", t1."Leaf_71", t1."Leaf_73", t1."Leaf_74", t1."Leaf_77", t1."Leaf_78", t1."Leaf_81", t1."Leaf_83", t1."Leaf_87", t1."Leaf_88", t1."Leaf_89", t1."Leaf_91", t1."Leaf_92", t1."Leaf_96", t1."Leaf_97", t1."Leaf_100", t1."Leaf_102", t1."Leaf_103", t1."Leaf_104", t1."Leaf_108", t1."Leaf_109", t1."Leaf_110", t1."Leaf_112", t1."Leaf_115", t1."Leaf_116", t1."Leaf_118", t1."Leaf_119", t1."Leaf_121", t1."Leaf_123", t1."Leaf_125", t1."Leaf_126" ) AS node_id
