"DT_output_9" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_9" AS t1
   LEFT OUTER JOIN
   "DT_node_data_9" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_10" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_5", t1."Leaf_9", t1."Leaf_10", t1."Leaf_12", t1."Leaf_16", t1."Leaf_17", t1."Leaf_18", t1."Leaf_23", t1."Leaf_24", t1."Leaf_25", t1."Leaf_27", t1."Leaf_28", t1."Leaf_30", t1."Leaf_32", t1."Leaf_35", t1."Leaf_36", t1."Leaf_37", t1."Leaf_39", t1."Leaf_40", t1."Leaf_42", t1."Leaf_46", t1."Leaf_47", t1."Leaf_50", t1."Leaf_55", t1."Leaf_56", t1."Leaf_58", t1."Leaf_59", t1."Leaf_60", t1."Leaf_63", t1."Leaf_64", t1."Leaf_65", t1."Leaf_67", t1."Leaf_68", t1."Leaf_69", t1."Leaf_71", t1."Leaf_72", t1."Leaf_76", t1."Leaf_77", t1."Leaf_80", t1."Leaf_81", t1."Leaf_84", t1."Leaf_85", t1."Leaf_87", t1."Leaf_89", t1."Leaf_90", t1."Leaf_93", t1."Leaf_94", t1."Leaf_100", t1."Leaf_104", t1."Leaf_105", t1."Leaf_106", t1."Leaf_110", t1."Leaf_112", t1."Leaf_113", t1."Leaf_114", t1."Leaf_116", t1."Leaf_117", t1."Leaf_118", t1."Leaf_120", t1."Leaf_121", t1."Leaf_123", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_7" > 5.500000) AND (t."X_3" > 8.500000) AND (t."X_8" <= 3.500000)) THEN 5 ELSE NULL END AS Leaf_5,
