   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_14" AS t1
   LEFT OUTER JOIN
   "DT_node_data_14" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_15" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_5", t1."Leaf_6", t1."Leaf_13", t1."Leaf_14", t1."Leaf_15", t1."Leaf_16", t1."Leaf_19", t1."Leaf_20", t1."Leaf_23", t1."Leaf_24", t1."Leaf_25", t1."Leaf_26", t1."Leaf_32", t1."Leaf_33", t1."Leaf_35", t1."Leaf_36", t1."Leaf_37", t1."Leaf_39", t1."Leaf_41", t1."Leaf_42", t1."Leaf_45", t1."Leaf_47", t1."Leaf_48", t1."Leaf_53", t1."Leaf_54", t1."Leaf_56", t1."Leaf_63", t1."Leaf_65", t1."Leaf_66", t1."Leaf_69", t1."Leaf_70", t1."Leaf_71", t1."Leaf_73", t1."Leaf_75", t1."Leaf_77", t1."Leaf_78", t1."Leaf_80", t1."Leaf_81", t1."Leaf_82", t1."Leaf_83", t1."Leaf_88", t1."Leaf_89", t1."Leaf_90", t1."Leaf_93", t1."Leaf_94", t1."Leaf_95", t1."Leaf_96", t1."Leaf_97", t1."Leaf_99", t1."Leaf_101", t1."Leaf_102", t1."Leaf_105", t1."Leaf_108", t1."Leaf_109", t1."Leaf_110", t1."Leaf_112", t1."Leaf_115", t1."Leaf_117", t1."Leaf_118", t1."Leaf_120", t1."Leaf_121", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_2" <= 7.500000) AND (t."X_8" <= 4.500000) AND (t."X_7" <= 7.500000)) THEN 5 ELSE NULL END AS Leaf_5,
      CASE WHEN((t."X_2" <= 7.500000) AND (t."X_8" <= 4.500000) AND (t."X_7" > 7.500000)) THEN 6 ELSE NULL END AS Leaf_6,
      CASE WHEN((t."X_2" > 7.500000) AND (t."X_0" > 7.500000) AND (t."X_2" > 8.500000) AND (t."X_9" > 6.500000) AND (t."X_9" <= 8.000000)) THEN 13 ELSE NULL END AS Leaf_13,
      CASE WHEN((t."X_2" > 7.500000) AND (t."X_0" > 7.500000) AND (t."X_2" > 8.500000) AND (t."X_9" > 6.500000) AND (t."X_9" > 8.000000)) THEN 14 ELSE NULL END AS Leaf_14,
