      CASE WHEN((t."X_2" > 7.500000) AND (t."X_0" > 7.500000) AND (t."X_2" <= 8.500000) AND (t."X_8" <= 6.500000) AND (t."X_3" > 7.000000) AND (t."X_9" <= 7.500000)) THEN 23 ELSE NULL END AS Leaf_23,
      CASE WHEN((t."X_2" > 7.500000) AND (t."X_0" > 7.500000) AND (t."X_2" <= 8.500000) AND (t."X_8" <= 6.500000) AND (t."X_3" > 7.000000) AND (t."X_9" > 7.500000)) THEN 24 ELSE NULL END AS Leaf_24,
      CASE WHEN((t."X_2" > 7.500000) AND (t."X_0" > 7.500000) AND (t."X_2" <= 8.500000) AND (t."X_8" <= 6.500000) AND (t."X_3" <= 7.000000) AND (t."X_1" <= 0.500000)) THEN 25 ELSE NULL END AS Leaf_25,
      CASE WHEN((t."X_2" > 7.500000) AND (t."X_0" > 7.500000) AND (t."X_2" <= 8.500000) AND (t."X_8" <= 6.500000) AND (t."X_3" <= 7.000000) AND (t."X_1" > 0.500000)) THEN 26 ELSE NULL END AS Leaf_26,
      CASE WHEN((t."X_2" > 7.500000) AND (t."X_0" <= 7.500000) AND (t."X_8" > 7.500000) AND (t."X_7" <= 2.500000) AND (t."X_9" > 7.500000)) THEN 32 ELSE NULL END AS Leaf_32,
      CASE WHEN((t."X_2" > 7.500000) AND (t."X_0" <= 7.500000) AND (t."X_8" > 7.500000) AND (t."X_7" > 2.500000) AND (t."X_3" <= 8.500000)) THEN 33 ELSE NULL END AS Leaf_33,
