"DT_output_15" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_15" AS t1
   LEFT OUTER JOIN
   "DT_node_data_15" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_16" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_3", t1."Leaf_8", t1."Leaf_10", t1."Leaf_12", t1."Leaf_13", t1."Leaf_14", t1."Leaf_17", t1."Leaf_18", t1."Leaf_19", t1."Leaf_24", t1."Leaf_29", t1."Leaf_31", t1."Leaf_33", t1."Leaf_35", t1."Leaf_36", t1."Leaf_39", t1."Leaf_42", t1."Leaf_44", t1."Leaf_45", t1."Leaf_47", t1."Leaf_48", t1."Leaf_52", t1."Leaf_53", t1."Leaf_54", t1."Leaf_57", t1."Leaf_58", t1."Leaf_59", t1."Leaf_60", t1."Leaf_62", t1."Leaf_65", t1."Leaf_69", t1."Leaf_70", t1."Leaf_73", t1."Leaf_74", t1."Leaf_75", t1."Leaf_76", t1."Leaf_77", t1."Leaf_78", t1."Leaf_79", t1."Leaf_81", t1."Leaf_82", t1."Leaf_86", t1."Leaf_88", t1."Leaf_93", t1."Leaf_94", t1."Leaf_95", t1."Leaf_97", t1."Leaf_100", t1."Leaf_101", t1."Leaf_104", t1."Leaf_105", t1."Leaf_106", t1."Leaf_107", t1."Leaf_109", t1."Leaf_110", t1."Leaf_113", t1."Leaf_116", t1."Leaf_117", t1."Leaf_118", t1."Leaf_120", t1."Leaf_121", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_8" <= 4.500000) AND (t."X_7" <= 7.500000)) THEN 3 ELSE NULL END AS Leaf_3,
      CASE WHEN((t."X_8" <= 4.500000) AND (t."X_7" > 7.500000) AND (t."X_0" > 5.500000) AND (t."X_8" > 2.500000)) THEN 8 ELSE NULL END AS Leaf_8,
      CASE WHEN((t."X_8" <= 4.500000) AND (t."X_7" > 7.500000) AND (t."X_0" > 5.500000) AND (t."X_8" <= 2.500000) AND (t."X_9" > 7.500000)) THEN 10 ELSE NULL END AS Leaf_10,
