"DT_output_20" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_20" AS t1
   LEFT OUTER JOIN
   "DT_node_data_20" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_21" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_2", t1."Leaf_13", t1."Leaf_16", t1."Leaf_17", t1."Leaf_19", t1."Leaf_20", t1."Leaf_24", t1."Leaf_25", t1."Leaf_26", t1."Leaf_29", t1."Leaf_30", t1."Leaf_31", t1."Leaf_33", t1."Leaf_35", t1."Leaf_37", t1."Leaf_38", t1."Leaf_40", t1."Leaf_45", t1."Leaf_46", t1."Leaf_48", t1."Leaf_49", t1."Leaf_51", t1."Leaf_52", t1."Leaf_55", t1."Leaf_56", t1."Leaf_57", t1."Leaf_62", t1."Leaf_63", t1."Leaf_65", t1."Leaf_66", t1."Leaf_69", t1."Leaf_70", t1."Leaf_73", t1."Leaf_75", t1."Leaf_77", t1."Leaf_78", t1."Leaf_80", t1."Leaf_81", t1."Leaf_82", t1."Leaf_83", t1."Leaf_89", t1."Leaf_90", t1."Leaf_91", t1."Leaf_92", t1."Leaf_98", t1."Leaf_99", t1."Leaf_100", t1."Leaf_102", t1."Leaf_103", t1."Leaf_104", t1."Leaf_106", t1."Leaf_107", t1."Leaf_108", t1."Leaf_111", t1."Leaf_112", t1."Leaf_114", t1."Leaf_115", t1."Leaf_116", t1."Leaf_118", t1."Leaf_120", t1."Leaf_121", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_4" > 4.500000)) THEN 2 ELSE NULL END AS Leaf_2,
      CASE WHEN((t."X_4" <= 4.500000) AND (t."X_7" > 5.500000) AND (t."X_0" <= 6.500000) AND (t."X_8" <= 4.500000) AND (t."X_7" <= 7.500000) AND (t."X_9" > 7.000000) AND (t."X_2" <= 4.500000)) THEN 13 ELSE NULL END AS Leaf_13,
