   LEFT OUTER JOIN
   "DT_node_data_24" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_25" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_6", t1."Leaf_15", t1."Leaf_16", t1."Leaf_18", t1."Leaf_19", t1."Leaf_21", t1."Leaf_26", t1."Leaf_27", t1."Leaf_28", t1."Leaf_29", t1."Leaf_32", t1."Leaf_33", t1."Leaf_34", t1."Leaf_37", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_42", t1."Leaf_46", t1."Leaf_48", t1."Leaf_50", t1."Leaf_51", t1."Leaf_53", t1."Leaf_54", t1."Leaf_55", t1."Leaf_59", t1."Leaf_61", t1."Leaf_62", t1."Leaf_63", t1."Leaf_65", t1."Leaf_67", t1."Leaf_68", t1."Leaf_69", t1."Leaf_71", t1."Leaf_72", t1."Leaf_74", t1."Leaf_79", t1."Leaf_81", t1."Leaf_82", t1."Leaf_84", t1."Leaf_85", t1."Leaf_86", t1."Leaf_87", t1."Leaf_89", t1."Leaf_90", t1."Leaf_94", t1."Leaf_95", t1."Leaf_99", t1."Leaf_101", t1."Leaf_102", t1."Leaf_103", t1."Leaf_109", t1."Leaf_110", t1."Leaf_112", t1."Leaf_114", t1."Leaf_115", t1."Leaf_116", t1."Leaf_119", t1."Leaf_120", t1."Leaf_122", t1."Leaf_123", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
