   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_31" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_6", t1."Leaf_9", t1."Leaf_10", t1."Leaf_12", t1."Leaf_15", t1."Leaf_19", t1."Leaf_20", t1."Leaf_21", t1."Leaf_22", t1."Leaf_23", t1."Leaf_27", t1."Leaf_32", t1."Leaf_34", t1."Leaf_36", t1."Leaf_37", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_43", t1."Leaf_45", t1."Leaf_51", t1."Leaf_52", t1."Leaf_56", t1."Leaf_57", t1."Leaf_58", t1."Leaf_59", t1."Leaf_60", t1."Leaf_62", t1."Leaf_63", t1."Leaf_64", t1."Leaf_66", t1."Leaf_67", t1."Leaf_68", t1."Leaf_70", t1."Leaf_76", t1."Leaf_78", t1."Leaf_79", t1."Leaf_82", t1."Leaf_84", t1."Leaf_85", t1."Leaf_86", t1."Leaf_90", t1."Leaf_91", t1."Leaf_93", t1."Leaf_94", t1."Leaf_95", t1."Leaf_96", t1."Leaf_99", t1."Leaf_100", t1."Leaf_105", t1."Leaf_106", t1."Leaf_108", t1."Leaf_109", t1."Leaf_111", t1."Leaf_112", t1."Leaf_115", t1."Leaf_117", t1."Leaf_119", t1."Leaf_120", t1."Leaf_121", t1."Leaf_122", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_3" > 7.500000) AND (t."X_6" > 6.500000)) THEN 6 ELSE NULL END AS Leaf_6,
      CASE WHEN((t."X_3" > 7.500000) AND (t."X_6" <= 6.500000) AND (t."X_7" > 5.500000) AND (t."X_4" <= 2.500000)) THEN 9 ELSE NULL END AS Leaf_9,
      CASE WHEN((t."X_3" > 7.500000) AND (t."X_6" <= 6.500000) AND (t."X_7" > 5.500000) AND (t."X_4" > 2.500000)) THEN 10 ELSE NULL END AS Leaf_10,
      CASE WHEN((t."X_3" <= 7.500000) AND (t."X_8" > 4.500000) AND (t."X_6" > 1.500000)) THEN 12 ELSE NULL END AS Leaf_12,
      CASE WHEN((t."X_3" <= 7.500000) AND (t."X_8" > 4.500000) AND (t."X_6" <= 1.500000) AND (t."X_7" > 5.500000) AND (t."X_4" <= 6.500000)) THEN 15 ELSE NULL END AS Leaf_15,
