      CASE WHEN((t."X_3" <= 7.500000) AND (t."X_8" > 4.500000) AND (t."X_6" <= 1.500000) AND (t."X_7" > 5.500000) AND (t."X_4" > 6.500000) AND (t."X_4" <= 7.500000) AND (t."X_9" > 5.000000)) THEN 20 ELSE NULL END AS Leaf_20,
